import React from "react";
import { Row, Col, Button } from "reactstrap";

import Widget from "../../components/Widget";

const Reviews = () => (
	<div>
		<h1 className="page-title">
			Reviews - <span className="fw-semi-bold">Getting an analysis</span>
		</h1>
		<Widget
			title={
				<h5>
					Headings{" "}
					<small className="text-muted">Default and customized</small>
				</h5>
			}
		>
			<h4>Default headings</h4>
			<p>Basic headings for everyday use</p>
			<form>
				<div class="mb-3">
					<label class="form-label">Введите текст своего отзыва здесь...</label>
					<input type="text" id="disabledTextInput" class="form-control" placeholder="Disabled input"></input>
				</div>
				<textarea className="widget-padding-md w-100 h-100 text-left border rounded" placeholder="Введите свой отзыв сюда..."></textarea>
				<Button color="default" className="mr-2" size="sm">Отправить</Button>
			</form>
		</Widget>
	</div>
);

export default Reviews;
